import React, { Component } from 'react';


class Navbar extends Component {

    render() {
        return (
            <nav className="nav-link">
                Date-Nite
                <ul>
                    <li>Profile</li>
                    <li>Locations</li>
                    <li>Matches</li>
                </ul>
            </nav>
        )
    }
}

export default Navbar
